import logo from './logo.svg';
import './App.css';
import ContentList from './ContentCard/ContentList';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <ContentList />
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Time for <code>experiments</code> !
        </p>
      </header>
    </div>
  );
}

export default App;
